import "./App.css";
import {PathSplitter} from "./PathSplitter";
import SVGRenderer from "./SVGRenderer";

function App() {
    const input = "";
    const color = "#393A3D";
    // const color = "#8D9096";
    const white = "#FFFFFF";
    let last = "";
    let finalStr = "";
    PathSplitter(input).forEach(x => {
        const curr = x.split(" ")[1];
        const finalColor = last === curr ? white : color;
        last = curr;
        finalStr += `
      <path
        android:pathData="${x}"
        android:fillColor="${finalColor}"/>
      `;
    });
    console.log(finalStr);
    return (
        <div className="App">
            <header className="App-header">
                <SVGRenderer />
            </header>
        </div>
    );
}

export default App;
